import React, { useState, useRef } from 'react';
import { Button } from '../components/ui/button';
import { Input } from '../components/ui/input';
import { Card, CardContent } from '../components/ui/card';
import { Upload, Eye, RotateCw, ZoomIn, ZoomOut, Maximize } from 'lucide-react';
import { Badge } from '../components/ui/badge';
import PanoramaViewer from './panoramicViewer';


const Property360Viewer = () => {
  const [property360Image, setProperty360Image] = useState<string>('');
  const [isFullscreen, setIsFullscreen] = useState(false);
  const fileInputRef = useRef<HTMLInputElement>(null);
  const viewerRef = useRef<HTMLDivElement>(null);

  const handleFileSelect = (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0];
    if (!file) return;

    const reader = new FileReader();
    reader.onload = (event) => {
      if (event.target?.result) {
        setProperty360Image(event.target.result as string);
      }
    };
    reader.readAsDataURL(file);
  };

  const toggleFullscreen = () => {
    if (!document.fullscreenElement && viewerRef.current) {
      viewerRef.current.requestFullscreen();
      setIsFullscreen(true);
    } else {
      document.exitFullscreen();
      setIsFullscreen(false);
    }
  };

  const test: string = "data:image/jpeg;base64,"

  const openPreview = () => {
    if (property360Image) {
      const newWindow = window.open();
      if (newWindow) {
        newWindow.document.write(`
          <html>
            <head>
              <title>Tour 360 - Imvel Completo</title>
              <style>
                body { 
                  margin: 0; 
                  padding: 0; 
                  background: #000; 
                  font-family: Arial, sans-serif;
                  overflow: hidden;
                }
                .viewer-container {
                  position: relative;
                  width: 100vw;
                  height: 100vh;
                  display: flex;
                  align-items: center;
                  justify-content: center;
                }
                .viewer-image {
                  width: 100%;
                  height: 100%;
                  object-fit: cover;
                  cursor: grab;
                }
                .viewer-image:active {
                  cursor: grabbing;
                }
                .controls {
                  position: absolute;
                  top: 20px;
                  left: 20px;
                  background: rgba(0,0,0,0.7);
                  padding: 15px;
                  border-radius: 8px;
                  color: white;
                }
                .instructions {
                  position: absolute;
                  bottom: 20px;
                  left: 50%;
                  transform: translateX(-50%);
                  background: rgba(0,0,0,0.7);
                  padding: 10px 20px;
                  border-radius: 20px;
                  color: white;
                  font-size: 14px;
                }
              </style>
            </head>
            <body>
              <div class="viewer-container">
                <img src="${property360Image}" alt="Tour 360 do Imvel" class="viewer-image" />
                <div class="controls">
                  <h3> Tour Virtual 360</h3>
                  <p>Vista geral do imvel</p>
                </div>
                <div class="instructions">
                   Arraste para explorar  ESC para sair
                </div>
              </div>
              <script>
                let isDragging = false;
                let startX = 0;
                let startY = 0;
                const img = document.querySelector('.viewer-image');
                
                img.addEventListener('mousedown', (e) => {
                  isDragging = true;
                  startX = e.clientX;
                  startY = e.clientY;
                });
                
                document.addEventListener('mousemove', (e) => {
                  if (!isDragging) return;
                  const deltaX = e.clientX - startX;
                  const deltaY = e.clientY - startY;
                  // Simular rotao 360
                  img.style.transform = \`translateX(\${deltaX * 0.5}px) translateY(\${deltaY * 0.3}px)\`;
                });
                
                document.addEventListener('mouseup', () => {
                  isDragging = false;
                  img.style.transform = 'none';
                });
                
                document.addEventListener('keydown', (e) => {
                  if (e.key === 'Escape') {
                    window.close();
                  }
                });
              </script>
            </body>
          </html>
        `);
      }
    }
  };

  return (
    <div className="space-y-4">
      <Input
        ref={fileInputRef}
        type="file"
        accept="image/*"
        onChange={handleFileSelect}
        className="hidden"
      />

      {property360Image ? (
        <div className="border-2 border-dashed border-blue-300 rounded-lg p-8 text-center bg-gradient-to-br from-blue-50 to-cyan-50">
          <div className="w-16 h-16 bg-gradient-to-r from-blue-500 to-cyan-500 rounded-full flex items-center justify-center mx-auto mb-4">
            <span className="text-white text-2xl">360</span>
          </div>
          <h3 className="text-lg font-medium text-slate-800 mb-2">
            No h imagem 360
          </h3>
          <p className="text-sm text-slate-500 mb-4">
            Adicione uma imagem panormica para criar um tour virtual do imvel.
          </p>
        </div>
      ) : (
        <div className="space-y-4">
          <PanoramaViewer 
            panoramaUrl={test}
            height="50vh"
            width="100%"
          />



        </div>
      )}
    </div>
  );
};

export default Property360Viewer;
